window.bookSummaryJSON = "<p>Hailey Freeman goes to Blackwood with a specific mission - at least on the surface. When a sudden tragedy thrusts her into chaos, she expects to find herself mired in confusion, bereft, while she figures out how to pick up the pieces.</p> <p>Instead, she finds comfort, clarity, and - baffling - familiarity in the arms of Ellis Boyd.</p> <p>A stranger.</p> <p>A stranger who can’t help wondering if he knows Hailey somehow, met her somewhere, another time that they just can’t remember—the only explanation for their swift, consuming connection. </p> <p>At least, the only one that makes sense....</p> <p>Right?</p>"; 
